import styles from "../CSS/Home.module.css";

function AdminHome() {
  return (
    <div className={styles.cont}>
      <div className="card">Crops</div>
      <div className="card">Schemes</div>
      <div className="card">Applications</div>
    </div>
  );
}

export default AdminHome;
